script: |
  super -f text -I q12542.spq | sort > q12542.out

inputs:
  - name: q12542.spq
    data: |
      SELECT - + col0 * - 99 FROM tab1 (FORMAT parquet) WHERE - - col2 / ( + + 81 ) + + 53 + 65 / - col0 * - - col2 + 26 + col1 NOT BETWEEN NULL AND + ( - 74 );
  - name: tab1

outputs:
  - name: q12542.out
    data: |
      5049
      8415
      9009
